var layers = d3.entries(data).map(function(d) { return {"x":  d.key,"y": d.value[0][1], "y0" : 0} })



var n = 1, // number of layers
m = 32; // number of samples per layer

var margin = {top: 10, right: 0, bottom: 0, left: 32},
width = 700 - margin.left - margin.right,
height = 410 - margin.top - margin.bottom;

var x = d3.scale.ordinal()
.domain(d3.keys(data))
.rangeRoundBands([0, width], .08);

var y = d3.scale.linear()
.domain([0, 1])
.range([height-20, 0]);

var color = d3.scale.linear()
.domain([0, n - 1])
.range(["#b58863", "#f0d9b5"]);

var yAxis = d3.svg.axis()
.scale(y)
.tickSize(0)
.tickPadding(6)
.orient("left");
var xAxis = d3.svg.axis()
.scale(x)
.tickSize(0)
.tickPadding(6)
.orient("bottom");

var svg = d3.select("body").select("#svgHere").append("svg")
.attr("width", width + margin.left + margin.right)
.attr("height", height + margin.top + margin.bottom)
.append("g")
.attr("transform", "translate(32,10)");

var rect = svg.selectAll("rect")
.data(layers)
.enter().append("rect")
.attr("x", function(d) { return x(d.x); })
.attr("y", height)
.attr("width", x.rangeBand())
.attr("height", 0)
.attr('fill','#b58863');

.delay(function(d, i) { return i * 10; })
.attr("y", function(d){return y(d.y);})
.attr("height", function(d) { return  height-20-y(d.y); });

.attr("class", "x axis")
.attr("transform", "translate(0, 380)")
.call(xAxis);

.attr("class", "y axis")
.attr("transform","translate(0,0)")
.call(yAxis);

function change() {

  // Copy-on-write since tweens are evaluated after a delay.
  var x0 = x.domain(layers.sort(this.checked

    : function(a, b) { return d3.ascending(a.x, b.x); })
    .map(function(d) { return d.x; }))
    .copy();

    var transition = svg.transition().duration(750),
    delay = function(d, i) { return i * 10; };

    transition.selectAll("rect")
    .delay(delay)
    .attr("x", function(d) { return x0(d.x); });

    transition.select(".x.axis")
    .call(xAxis)
    .selectAll("g")
    .delay(delay);
